import Hero from "../../blocks/blog/blog";
import Blog from "../../blocks/hero/hero";
import Services from "../../blocks/services/services";

function MainPage() {
  return (
    <>
      <Hero />
      <Blog />
      <Services />
    </>
  );
}

export default MainPage;
